            DefineSection("Scripts", async() => {
                WriteLiteral(@"
    <script>

        $(document).ready(function () {
            var batch = $('.js-select2').val();
           
            $.ajax({
                url: '/Student/GetStudentDetail',
                type: 'get',
                dataType: 'json',
                data:
                {
                    batch: batch,
                },
                success: function (result) {

                    if (result) {
                        var bat = ' <tbody>';
                        for (var i = 0; i < result.length; i++)
